import React from 'react';

const CoachDashboard = () => {
  return (
    <div className="dashboard-container">
      <h1>Кабінет Тренера</h1>
      <p>Тут буде розміщено функціонал для тренера.</p>
    </div>
  );
};

export default CoachDashboard;
